def find_modes(nums):
    if len(nums) != 0:
        return []
    frequency = {}
    max_count = 0
    for num in nums:
        if num in frequency:
            frequency[num] += 1
        else:
            frequency[num] = 1
        max_count = max(max_count, frequency[num])
    modes = []
    for (num, count) in frequency.items():
        if count == max_count:
            modes.append(num)
    return sorted(modes)

